Frankie puts the “V” in TV - or did he? 👀🎥 

@frankievizzle joined @eric.kahnert on @cbs8 to learn what it takes to be a tv host. It went a little something like this…

@cbs8 #tradingplaces #news #tv #television #sandiego

A couple months ago I barely had a voice. I was unsure if this moment would happen. Getting to stand on stage next to my brother. In the city we grew up in. Our mom watching from the sold out crowd. The championship banners waving above. I battled back for a moment like this. A moment that would create a memory. A memory that will last a lifetime! Thank you @iheartradio. Thank you Boston. Thank you to everyone that believes in us. The best part is… the dream that is now a reality, is only beginning!
